         SELECT v_taskmember_successful_report.year,
            (0)::double precision AS quarter,
            (0)::double precision AS month,
            ''::character varying AS location,
            v_taskmember_successful_report.type,
            sum(v_taskmember_successful_report.value) AS value
           FROM test2.v_taskmember_successful_report
          GROUP BY v_taskmember_successful_report.year, v_taskmember_successful_report.type) y
  ORDER BY y.year, y.type;


